import './App.css';
import { Routes, Route } from 'react-router-dom';
import HomePage from './pages/homepage/homepage.component';

const Cloth = () => {
  return <h1>This is Cloth component</h1>
}

function App() {
  return (
    <div>
      <Routes>
        <Route exact path='/' element={<HomePage />} />
        <Route path='/cloth' element={<Cloth />} />
      </Routes>
    </div>
  );
}

export default App;
